    public function getBankAcc() {
        
        $this->xml_post = "<?xml version='1.0' encoding='utf-8' ?>
        <Envelope xmlns='http://schemas.xmlsoap.org/soap/envelope/'>
            <Body>
                <GetBankAcc xmlns='urn:microsoft-dynamics-schemas/codeunit/ESS_Intergration'/>
            </Body>
        </Envelope>";
        
        
        
        $this->curl = curl_init();
        curl_setopt_array($this->curl, array(
            CURLOPT_URL => $this->soapUrl,
            CURLOPT_RETURNTRANSFER => true,
            CURLOPT_ENCODING => "",
            CURLOPT_MAXREDIRS => 10,
            CURLOPT_TIMEOUT => 0,
            CURLOPT_FOLLOWLOCATION => true,
            CURLOPT_HTTP_VERSION => CURL_HTTP_VERSION_1_1,
            CURLOPT_CUSTOMREQUEST => "POST",
            CURLOPT_POSTFIELDS =>$this->xml_post,
            CURLOPT_HTTPHEADER => array(
                "Content-Type: text/xml; charset=utf-8",
                "SoapAction: urn:microsoft-dynamics-schemas/codeunit/ESS_Intergration:GetBankAcc",
                "Authorization: Basic " .base64_encode($this->credentials). ""
            ),
        ));
        
        $this->xml_res = curl_exec($this->curl);
        
        echo "CURL RES: <br>";
        echo $this->xml_res;
        
        if($this->xml_res === false) {
            $this->res = 'Curl error: ' . curl_error($this->curl);
            $this->obj = (object) array('co_connect' => 0, 'co_res' => $this->res);
            
            echo "CURL ERROR: <br>";
            echo $this->res;
            
        } else {
            
            echo "CURL RES SUCCESS: <br>";
            echo $this->xml_res;
            //$this->xml_res = curl_exec($this->curl);
            // converting 
            $this->xml_res1 = str_replace("<Soap:Body>","",$this->xml_res);
            $this->xml_res1 = str_replace('<GetBankAcc_Result xmlns="urn:microsoft-dynamics-schemas/codeunit/ESS_Intergration">','',$this->xml_res1);
            $this->xml_res1 = str_replace('<GetBankAcc_Result>','',$this->xml_res1);
            $this->xml_res2 = str_replace("</Soap:Body>","",$this->xml_res1);
            $this->xml_res2 = str_replace("</GetBankAcc_Result>","",$this->xml_res2);
            $this->xml_res2 = str_replace("</GetBankAcc_Result>","",$this->xml_res2);
            $this->xml_res2 = str_replace('<Soap:Envelope xmlns:Soap="http://schemas.xmlsoap.org/soap/envelope/"><return_value>','',$this->xml_res2);
            $this->xml_res2 = str_replace('</return_value></Soap:Envelope>','',$this->xml_res2);
            
            $this->parser = trim($this->xml_res2);
            //$jsonData = json_decode($this->parser);
            
            echo "JSON RESPONSE: <br>";
            echo $this->parser;
            
            
            
        }
        
        //echo json_encode($this->obj);
        
    }
    
